import Ride from './RideButton';
import {
    withGoogleMap,
    GoogleMap,
    Marker,
  } from "react-google-maps";

function Map(pos, passengers) {

    const mapOptions = {
        disableDefaultUI: true
      };


    const MapWithAMarker = withGoogleMap(props =>


        <GoogleMap
          defaultZoom={10}
          defaultCenter={{ lat: pos["pos"][0], lng: pos["pos"][1]}}
          options={mapOptions}
        >
          <Marker
            position={{ lat: pos["pos"][0], lng: pos["pos"][1] }}
          />

          {passengers.map((passenger) =>(
              <Marker
                position={{ lat: passenger.xy[0], lng: passenger.xy[1] }}
              />
            ))}

        </GoogleMap>
      );



    return(
            <div className="map-wrapper-div">
                <>
                <MapWithAMarker
                    containerElement={<div style={{ height: `100%`}} />}
                    mapElement={<div className="map-div"/>}
                />
                </>
            </div>
    )
}

export default Map
